/* end domain */

html, body {
    background: #282C2F!important;
}

:root {
    --text-color: #fff;
    --bg-color: #282C2F;
    --card-bg-color: #282C2F;
    --warning-color: #323639;
    --secondary-2-color: #282C2F;
    --card-bg-color: #282C2F; 
}

*, :after, :before{
    box-shadow: none!important;
}

.TaskItem__Stretched {
    border: none!important;
}

.CardScrollView__scrollbarContainer {
    background: #282C2F;
}

.AppSidebar__newItem__input {
    background: #282C2F;
}

TaskGroupsQuickAddBar__inputContainer {
    border: thin dashed #aaa!important;
}

.SubTaskItem__textField {
    color: #fff;
}


button.ButtonRounded.ButtonRounded--premiumTheme {
    display: none;
}

.TaskGroupsQuickAddBar__inputContainer {
    border: var(--TaskGroupsQuickAddBar-input-border-width) dashed var(--secondary-1-color);
}

.PaneButton {
    height: 70px;
    display: block;
    overflow: hidden;
    font-size: var(--xs-font-size);
    margin-bottom: calc(var(--gutter)/2);
    background-image: none;
    background-color: var(--card-bg-color);
    border: thin dashed var(--secondary-2-color);
    border-radius: var(--border-radius);
    box-shadow: var(--pane-box-shadow);
    color: var(--text-color);
}

.ButtonRounded--reminderTheme {
    background-color: var(--warning-color);
    border-color: #1a2632;
    color: var(--text-color);
}

.AppHeaderNewTaskButton {
    background-color: #323639;
    color: var(--text-color);
}

.AppSidebar__version {
    bottom: -40px;
}

.ToolBarControlButton--selected {
    color: #ccc;
    background-color: #282C2F;
}

.AppSidebarCategoryItemAllTasks__contents:hover {
    color: var(--text-color);
    background-color: #323639;
}

.AppSidebarCategoryItem__contents:hover {
    background-color: #323639;
}

.InlineRemindersReminder {
    border: 0px solid var(--secondary-2-color);
}

